import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
// redux
import { Provider } from 'react-redux';
import store from './store';
// CSS

// import './App.css';
// import './css/stuck.css';
// import './css/landing.css';
// import './css/business_dashboard.css';
// import './css/create_project_business.css';
// import './css/project_business.css';
// import './css/solver_dashboard.css';
// import './css/whatwedo.css';
// import './css/whoweare.css';

// COMPONENTS
// common
import Landing from './components/layout/Landing';
// company
import Company_login from './components/company/auth/Company_login';
// solver
import Solver_login from './components/solver/auth/Solver_login';

const App = () => 
  <Provider store={store}>
  <Router>

<Fragment>

  <Switch>
    <Route exact path='/' component={Landing} />
  </Switch>

  <Switch>
    <Route exact path="/company_login" component={Company_login} />
  </Switch>

  <Switch>
    <Route exact path ="/solver_login" component={Solver_login} />
  </Switch>

</Fragment>

</Router>

  </Provider>

export default App;
